  const handleSubmit = (e) => {
    e.preventDefault();
    const code = { postal };
  };

  return (
    <div className="address">
      <Container>
        <Row>
          <Col>
            <h2 className="bold">Find out if the salad bowl delivers to:</h2>
            <form onSubmit={handleSubmit}>
              <label></label>
              <input
                type="text"
                required
                value={postal}
                onChange={(e) => setPostal(e.target.value)}
              />
              <br></br>
              <button href="address">Continue</button>
            </form>
          </Col>
          <Col></Col>
          <Col></Col>
        </Row>
      </Container>
    </div>
  );
};

